package pdfTest;

import sun.misc.BASE64Decoder;

import java.io.*;

/**
* @ClassName: TransImageUtil 
* @Description: PDF转换公共类
* @author 
* @date 2020年07月01日 上午11:10:07 
*  
*/
public class TransPdfUtil {

	public static void main(String[] args) {
		StringBuilder b = new StringBuilder();
		b.append("YQDZHD202005060000790971.pdf,");
		b.append("");
		System.out.println(b.toString());
		System.out.println("文件名:" + b.toString().split(",")[0]);
		System.out.println("加密内容:"+ b.toString().split(",")[1].substring(9));
		base64StringToPDF(b.toString().split(",")[1].substring(9));
	}

	static BASE64Decoder decoder = new sun.misc.BASE64Decoder();

	static void base64StringToPDF(String base64sString) {
		BufferedInputStream bin = null;
		FileOutputStream fout = null;
		BufferedOutputStream bout = null;
		try {
			// 将base64编码的字符串解码成字节数组
			byte[] bytes = decoder.decodeBuffer(base64sString);
			// apache公司的API
			// byte[] bytes = Base64.decodeBase64(base64sString);
			// 创建一个将bytes作为其缓冲区的ByteArrayInputStream对象
			ByteArrayInputStream bais = new ByteArrayInputStream(bytes);
			// 创建从底层输入流中读取数据的缓冲输入流对象
			bin = new BufferedInputStream(bais);
			// 指定输出的文件
			File file = new File("D:\\test.pdf");
			// 创建到指定文件的输出流
			fout = new FileOutputStream(file);
			// 为文件输出流对接缓冲输出流对象
			bout = new BufferedOutputStream(fout);

			byte[] buffers = new byte[1024];
			int len = bin.read(buffers);
			while (len != -1) {
				bout.write(buffers, 0, len);
				len = bin.read(buffers);
			}
			// 刷新此输出流并强制写出所有缓冲的输出字节，必须这行代码，否则有可能有问题
			bout.flush();

			System.out.println("===================");
		} catch (IOException e) {
			e.printStackTrace();
		} finally {
			try {
				bin.close();
				fout.close();
				bout.close();
				System.out.println("*****************");
			} catch (IOException e) {
				e.printStackTrace();
			}
		}
	}
}
